import { stopWords, text } from "./stopWords.js";

import React, { useState, useEffect } from "react";

const Parser = () => {
  useEffect(() => {
    fetch("/tokens", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(text),
    })
      .then((response) => response.text())
      .then((data) => {
        console.log(data);
      })
      .catch((error) => {
        console.error(error);
      });
  }, []);

  return (
    <div>
      <h2>
        <br></br>
        Paragraphe :<br></br>
        <br></br>
        {text}
      </h2>
    </div>
  );
};

export default Parser;
